import { HttpClient } from "@angular/common/http";
import { Injectable } from '@angular/core';
import { Observable, of } from "rxjs";

@Injectable({
  providedIn: 'root'
})
export class GetBreedsService {
  constructor(private http: HttpClient) {}

    getBreeds(): Observable<any> {
    const breeds = of(this.http.get<any>("https://catfact.ninja/breeds").subscribe((data) => {
        return data;
    }));
    return breeds;
  }

   getNextBreeds(oldBreeds: any) {
    const breeds = of(oldBreeds.next_page_url.subscribe((data:any) => {
        return data;
    }));
    return breeds;
  }
   getPreviousBreeds(oldBreeds: any) {
    const breeds = of(oldBreeds.prev_page_url.subscribe((data:any) => {
        return data;
    }));
    return breeds;
  }
}
